import React from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Navbar from "./navbar";
import Activate from "./paths/activate";
import Sigin from "./paths/signin";
import Signup from "./paths/signup";

function Router() {
    return <BrowserRouter>
            <Navbar />

            <Switch>
                <Route exact path="/">
                    <div>Home</div>
                </Route>
                <Route  path="/signin">
                <Sigin />
                </Route>
                <Route  path="/signup">
                <Signup />
                </Route>
                <Route  path="/activate">
                <Activate />
                </Route>
            </Switch>
    </BrowserRouter>
}

export default Router;
